import React, {Component}from 'react';
import './App.css';
import './css/responsive.css';
import BaseComponent from './component/BaseComponent'

class App extends Component {
    constructor(props){
        super(props)
        this.state = {
            isClicked:true
        }
    }
    render(){
        return(
            this.state.isClicked ? <BaseComponent></BaseComponent> : <div>No ui</div>
        )
    }
}

export default App;
